    }

    setVideos(filteredVideos);
  }, [activeCategory, searchQuery]);

  // Handle video selection and modal
  const openVideoModal = (video) => {
    setSelectedVideo(video);
    setShowModal(true);
    document.body.style.overflow = "hidden";
